Przespolew Pański () is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Cek%C3%B3w-Kolonia"&gt;Gmina Ceków-Kolonia&lt;/a&gt;, within &lt;a href="Kalisz%20County"&gt;Kalisz County&lt;/a&gt;, &lt;a href="Greater%20Poland%20Voivodeship"&gt;Greater Poland Voivodeship&lt;/a&gt;, in west-central Poland. It lies approximately north-east of &lt;a href="Kalisz"&gt;Kalisz&lt;/a&gt; and south-east of the regional capital &lt;a href="Pozna%C5%84"&gt;Poznań&lt;/a&gt;.
